        spheres.push([[h/2+r*Math.cos(theta), h/2+r*Math.sin(theta)], 2*Math.PI*Math.random(), (1+2*Math.random())*1.5*pxs, [0, 0, 0, 0], [0, 0, 0, 0], 0.2*pxs*Math.random()+0.1*pxs]);
